import React, { Component } from "react";

class Form extends Component {
  initialState = {
    task: "",
    time: "",
  };

  handleChange = (event) => {
    const { task, value } = event.target;

    this.setState({
      [task]: value,
    });
  };

  state = this.initialState;

  render() {
    const { task, time } = this.state;

    return (
      <form>
        <label htmlFor="task">Task</label>
        <input
          type="text"
          task="task"
          id="task"
          value={task}
          onChange={this.handleChange}
        />
        <label htmlFor="time">Time</label>
        <input
          type="time"
          task="time"
          id="time"
          value={time}
          onChange={this.handleChange}
        />
      </form>
    );
  }
}
export default Form;
